facility.getInitialProps = async function () {
  let nextToken = null;
  let results = [];
  let errors;
  let raw = {};

  try {
    do {
      raw = await API.graphql(graphqlOperation(queries.listFacilitys, {
        limit: 10000,
        nextToken: nextToken
      }));
      nextToken = raw.data.listFacilitys.nextToken;
      raw.data.listFacilitys.items.map(value => results.push(value));
    } while (nextToken);
  } catch (error) {
    errors = error;
  }

  return {
    data: results,
    errors: errors
  };
};

export default facility;
